insert  into `wf_labnote`(`MyPK`,`Name`,`FK_Flow`,`X`,`Y`) values ('002_117_100_4','基层路线','002',117,100),('002_182_254_3','大于等于10天','002',182,254),('002_350_135_5','中层路线','002',350,135),('002_45_319_1','以表单的字段值做为方向条件。','002',45,319),('002_504_118_6','高层路线','002',504,118),('002_676_63_7','不同的人员走不同的路线可以避免一个人处理两个相同的节点，比如部门经理发起，部门经理审批的情况。\n由发起人的岗位来决定流程的路线可以在线上右键查看到岗位条件。','002',676,63),('002_92_421_2','小于10天','002',92,421),('004_363_161_1','CCFlow 把表单分为节点表单与独立表单两种类型，当期流程的三个节点，都禁用了节点表单的展现，不管您是否使用节点表单它都会存储。','004',363,161),('004_365_127_3','如果您要新创建表单，您也可以打开工具栏目上的表单库按钮。','004',365,127),('004_381_57_4','在此标签的正上方有一个运行按钮，就可以运行此流程并调试它。','004',381,57),('004_381_89_2','此流程为一个节点多个独立表单实例，您可以在节点上右键点绑定表单功能查看到当前节点要绑定的表单。','004',381,89),('005_306_213_1','发起节点可以有n个人接受，每个人处理完后就发送到汇总节点。','005',306,213),('008_396_107_1','在中间的子线程节点上配置一个SQL语句，此SQL必须具有No,Name两列，它是用来标识接受人编号\r接收人名称，其他的列与子线程的主表数据源字段对应，就可以实现自动数据copy.','008',396,107),('010_733_74_1','异表单分合流的另外一种形式，子线程中有多个节点。','010',733,74),('011_279_142_1','在实施项目过程中有n次发起施工流程，n次发起催款流程.','011',279,142),('011_362_50_2','在此标签的正上方有一个运行按钮，就可以运行此流程并调试它。','011',362,50),('018_124_220_1','请假天数小于10天','018',124,220),('018_193_181_2','请假天数大于等于10天','018',193,181),('018_361_58_3','\r关于sdk表单开发的说明:\r--------------------------------------\r1,在节点属性里的表单类型中您可以看到设置的是sdk表单.\r2,在/ccflow/SDKFlowDemo/Qingjia目录中，您可以看到如何做一个sdk表单，来实现你自己的业务逻辑.\r3,sdk表单，应用于超级复杂表单,ccform满足不了应用场景，或者从硬件设备上获取数据的表单.\r4,ccflow不建议使用sdk表单，如果遇到超级复杂的表单，您可以做一个自由表单然后用一个大框架控件.\r5,在保存与发送事件中为什么要把请假天数传递到节点表单中去？是因为需要节点表单来判断方向条件.\r','018',361,58),('023_239_304_1','张海城接受反馈','023',239,304),('023_260_204_3','周朋审核','023',260,204),('023_298_93_2','张海城发起','023',298,93),('028_107_176_1','研发部人员路线','028',107,176),('028_211_176_2','财务部路线','028',211,176),('028_328_65_4','此流程是为单元测试-以部门为转向条件的用例子测试','028',328,65),('028_462_203_3','人力资源部路线','028',462,203),('029_267_83_1','在方向连线上右键可以看到设置的开发者参数，详细请参考测试用例。','029',267,83),('032_456_18_1','超时处理测试用例','032',456,18),('033_221_79_1','具有质量考核流程, 关于质量考核请参考设计手册.','033',221,79),('036_294_195_1','自动阅读回执','036',294,195),('036_323_51_3','此流程为了测试已读回执\r在单元测试类库中有对应的测试案例','036',323,51),('036_357_439_2','由上一节点表单字段决定是否回执','036',357,439),('038_295_109_1','流程案例说明\n1，是同表单的分合流流程。\n2，子线程的各个成员填写完明细表后，就i汇总到下一个合流节点上去。\n设计步骤：\n1，分别在子线程与合流节点各设计一个明细表，让其明细表的字段与表名相同。\n2，在子线程的明细表的权限是WorkID,在合流节点的明细表名是FID。','038',295,109),('044_355_169_1','具有两段分合流的同表单分合流。','044',355,169),('045_539_147_1','具有两段分合流的同表单分合流。','045',539,147),('055_171_42_1','在节点的基本属性里设置是外部用户节点','055',171,42),('055_245_409_2','绑定了周朋处理','055',245,409),('055_318_229_3','在节点的基本属性里设置是外部用户节点','055',318,229),('055_484_37_4','\r注意在单元测试过程中用到了这个demo，请不要修改消息机制的规则，否则单元测试就运行不成功。\r\r1, 在开始节点设置了,向下一步接受人发送邮件，向指定字段作为手机号发送短信.\r\r2, 对应的单元测试： BP.UnitTesting.SendMessage\r ','055',484,37),('055_61_207_5','绑定了郭祥斌处理','055',61,207),('056_308_132_1','处理人就是提交人跳转-只有一个节点的情况。','056',308,132),('057_384_115_1','处理人就是提交人跳转-有2个节点的情况,测试是否可以自动跳转到最后一个步骤。','057',384,115),('063_282_57_1','自动跳转：\n研发部领导出现第二次后，就让他自动跳转。\r\rzhoutianjiao发起申请-qifenglin审批-liping审批-qifenglin自动跳过-zhoutianjiao得到反馈.','063',282,57),('063_42_354_2','处理人在这里步骤出现过','063',42,354),('068_322_128_1','只有在web.config中配置了 IsEnableTaskPool=1 才能看到共享任务\nccflow 驰骋工作流引擎的共享任务，应用背景，设置，设计，sdk接口\nhttp://bbs.ccflow.org/showtopic-2066.aspx','068',322,128),('069_333_97_1','以分流点的明细表作为子线程的接受人与数据源的案例。\n1，在分流点设置一个明细表，用来采集子线程的接受人员与子线程的主表数据。\n2，子线程主表的数据要与明细表的列字段对应，可以实现数据的自动copy.\n3,  分流点的明细表必须具备UserNo列，这两个列就是接受人员编号与名称。','069',333,97),('071_374_117_1','第一个节点批量发起，请参考流程属性设置。\n第二个节点批量审核，请参考节点属性设置。','071',374,117),('075_409_157_1','测试以url返回参数做为方向条件','075',409,157),('079_276_16_1','第一个节点批量发起，请参考流程属性设置。\n第二个节点分组审核，请参考节点属性设置，分组审核后发起的另外一个流程，另外一个流程就是此流程的父流程。\n\n应用场景:\n1,国土资源厅在审核多个项目，这多个项目具有一致性.\n2,多个项目需要发起一个公文流程，多个项目的子流程还要运转下去。\n3,新启动的流程是这多个项目的父流程。这种模式就是现有子流程再有父流程案例。\n','079',276,16),('082_283_102_1','我们用立项申请与项目验收使用前置导航来演示如何实现父子流程。\r\n\r\n应用背景：\r\n1，立项申请看作父流程，项目验收审批看作子流程。\r\n2，在发起项目验收前，需要出现一个项目列表，数据源来自于立项申请。\r\n3，项目验收流程运动到下一个节点后，系统就会自动设置父子关系。\r\n\r\n设置要点：\r\n1，此流程是一个普通的流程，他是一个父流程，为“项目单条验收”提供演示数据。\r\n2，打开项目单条验收子流程与，项目合并验收父流程的节点属性查看设置。\r\n2，查看配置方式，你会看到有PFlowNo,PWorkID,几个列，这些都是用于设置父子流程的标记。','082',283,102),('084_254_66_1','我们用这两个流程来演示如何实现表单树，如何根据表单树的WhoIsPK来控制表单的权限。','084',254,66),('086_270_23_1','说明:\r\n-----------------------------------------------\r\n1,此流程与082项目验收流程为同一个测试案例。\r\n2,是为了测试子流程的批量合并发起父亲流程.\r\n3,父流程的开始节点表单的明细表里具选择的子流程数据.\r\n4,如果父流程开始节点执行发送，有如下几种情况子流程也要执行发送.\r\n  4.1, 当前子流程没有运行完成.\r\n  4.2, 子流程的待办工作，当前人员可以处理.\r\n\r\n\r\n设置方法:\r\n------------------------------------------------\r\n1, 打开父流程的流程属性.\r\n2, 设置发起前导航模式\r\n3, 发起前置参数1，2，3分别参考本案例设置.\r\n4, 打开开始节点表单事件,设置装载前事件, 在装载前事件里可以完成数据的明细表填充.\r\n5,注意查看明细表的超连接，可以链接到子线程上面去。\r\n\r\n','086',270,23),('114_300_83_1','这个demo可以学习到如下几点：\n\n1，多附件，单附件的在分合流中的使用，分流节点到子线程到合流点\n数据如何进行传递的。\n\n2，在合流点如何查看子线城信息，并且对子线成删除驳回的操作。','114',300,83),('116_368_255_1','节点设置：\n1，该流程演示出开始节点以外，每个节点的处理人接受方式是有上一步选择。\n2，在节点访问规则里我们设置了，每个节点的接受人可以有那些节点来确定。\n\n应用场景：\n1，开始节点在启动时，就确定了每个节点的接受人。\n\n流程行走的路线是由方向条件决定的，开始节点以外的选择处理人是由开始节点人员确定的.','116',368,255),('119_494_19_1','测试手工转向','119',494,19),('120_315_189_1','自由流程，就是开始节点或者，中间的指定节点，可以自己定义流程运行的步骤，定义流程运行的人员。','120',315,189),('121_404_63_1','1, 该流程为自由流程的子流程.\r2, 用来演示子流程吊起它.\r3, 该流程流程属性里设置了它是子流程, 并且不能单独发起.\r4, ','121',404,63),('122_391_64_1','相关说明ccflow如何实现批次维度任务流程\rhttp://bbs.ccflow.org/showtopic-3070.aspx','122',391,64),('123_234_9_1','\n','123',234,9),('123_264_94_2','请参考说明书流程属性，数据存储模式。','123',264,94),('124_331_92_1','请参考说明书流程属性，数据存储模式。','124',331,92),('125_438_127_1','傻瓜表单工作模式，是一个比较精简的设计效率与工作效率比较高的模式。','125',438,127),('126_283_41_1','使用审核组件审批模式设计流程：\r\r1, 开始表单禁用审核组件。\r2，部门审批启用审核组件并设计表单.\r3, 后面的两个节点，表单为空但是已经启用了审核组件, 在表单属性的表单ID则是ND12602. \r\r ','126',283,41),('126_319_92_2','','126',319,92),('127_330_118_1','使用开发的表单，','127',330,118),('129_290_98_1','自定义表单开发演示','129',290,98),('130_193_17_1','测试1： 当前节点的所有未完成的子流程.\n--------------------------------------------\n在节点B上可以启动子流程，并设置了当前点所有的子流程的发送阻塞,使其子流程没有走完就不让其发送到节点C, 如果成功则设置有效.\n\n测试2： 按约定格式阻塞未完成子流程\n--------------------------------------------\n在节点C上可以发起了两个子流程催款与施工,但没有设置发送阻塞,让其在子流程没有完成的情况下向下运动到节点D.\n在节点D设置阻塞规则为{按约定格式阻塞未完成子流程}，看看是否正确的提示了信息。','130',193,17),('131_202_78_1','该流程是一个树形表单流程\n\n里面有word 表单与excel表单。\n\n在开始节点用户可以编辑该文件，在第2个节点要控制到不可以编辑该文件。\n','131',202,78),('132_240_22_1','该流程演示了如下功能:\r----------------------------\r1, 公文的签发。\r2，公文的修订的接受与拒绝。\r3，公文的流转设置。\r更多的信息请参考说明书公文按钮属性章节。','132',240,22),('132_240_98_2','','132',240,98),('139_63_239_1','如果客户需要发票就启用这个分支','139',63,239),('149_319_287_2','派送','149',319,287),('149_349_157_1','收文登记，增加附件','149',349,157),('150_227_327_3','增加红头','150',227,327),('150_228_84_1','发文拟稿，可以打开本地文档，打开模板、套红模板、修订留痕模式等','150',228,84),('150_230_166_2','部门审核，修订','150',230,166),('150_534_348_4','最后修订，盖章，接受修订','150',534,348),('158_372_123_1','在流程属性设置发起前置导航，设置的是按照表单列表。','158',372,123),('158_400_372_2','显示有数据的表单，因为没有数据的表单，就是不被显示的表单。','158',400,372),('163_289_76_1','\r自定义URL发起前置导航\r\r1, 打开流程属性，找到发起前置导航设置功能.\r\r2, 查看设置信息.\r\r3, 执行运行。','163',289,76),('167_138_281_1','中间节点是一个多人处理的工作节点，使用了协作规则，因为这里审核没有设置他们的先后顺序。\n\n如果有先后顺序的就是队列模式，协作模式与队列模式，都是由最后一个工作人员发送到下一个节点上去。\n\n关于多人处理节点的模式，请参考操作手册。\n','167',138,281),('167_250_287_2','','167',250,287),('168_362_36_1','\r\r应用场景:\r-------------------------\r\r1, 一条高速公路，有多个标段，每个标段，都需要单独审批， 这个审批走的是当前流程。\r\r2，只有每个标段审批完成的流程，才是可以合卷审批，就是为他们启动一个父流程。\r\r','168',362,36),('196_576_110_1','子流程结束后有三种情况.\n------------------------------------\n1.不处理(让父流程出现待办).\n2.自动运行到下一步骤.\n  如果自动运行到下一步骤，设置可以找到人可以找到到达的节点. 就可以, 否则不要选择这个规则.\n3.结束父流程.  ','196',576,110),('197_326_120_1','开始节点是否把父流程的数据带回来','197',326,120),('197_392_316_2','流程结束时是否父流程自动也结束了？','197',392,316),('205_174_364_1','金额小于等于1万','205',174,364),('205_323_246_2','金额大于1万','205',323,246),('205_662_127_3','开发要点说明：\n----------------------------------------\n1，在开始节点表单中执行了表单保存后事件，可以把从表的小计求和放到主表单的只读字段HeJi中，实现了人民币大写的转换。\n 这个功能是通过表单的事件完成的，可以在节点表单、表单事件产看到。\n2，根据报销金额，设置了方向条件，可以在连接线上点击右键，方向条件看到设置的方向转向。\n3，此流程采用了瀑布的方式设计，所以有两个【财务报销】节点，但是您可以看到，流程运动的路径不同，所以表单也不同。\n4，在各个节点上，用到了图片签名。这里特别说明：图片签名不等于电子签名。\n5, 设计此流程的表单全部采用了自由表单，如果想看傻瓜表单效果，请节点属性的表单类型进行设置。','205',662,127);

UNLOCK TABLES;

/*Table structure for table `wf_node` */

DROP TABLE IF EXISTS `wf_node`;

CREATE TABLE `wf_node` (
  `NodeID` int(11) NOT NULL DEFAULT '0' COMMENT '节点ID',
  `Step` int(11) DEFAULT '0' COMMENT '步骤(无计算意义)',
  `FK_Flow` varchar(150) DEFAULT NULL,
  `Name` varchar(200) DEFAULT NULL,
  `Tip` varchar(100) DEFAULT NULL COMMENT '操作提示',
  `WhoExeIt` int(11) DEFAULT '0' COMMENT '谁执行它',
  `ReadReceipts` int(11) DEFAULT '0' COMMENT '已读回执',
  `CondModel` int(11) DEFAULT '0' COMMENT '方向条件控制规则',
  `CancelRole` int(11) DEFAULT '0' COMMENT '撤销规则',
  `CancelDisWhenRead` int(11) DEFAULT '0' COMMENT '对方已经打开就不能撤销',
  `IsTask` int(11) DEFAULT '1' COMMENT '允许分配工作否?',
  `IsRM` int(11) DEFAULT '1' COMMENT '是否启用投递路径自动记忆功能?',
  `DTFrom` varchar(50) DEFAULT NULL COMMENT '生命周期从',
  `DTTo` varchar(50) DEFAULT NULL COMMENT '生命周期到',
  `IsBUnit` int(11) DEFAULT '0' COMMENT '是否是节点模版（业务单元）?',
  `FocusField` varchar(50) DEFAULT NULL COMMENT '焦点字段',
  `SaveModel` int(11) DEFAULT '0' COMMENT '保存方式',
  `IsGuestNode` int(11) DEFAULT '0' COMMENT '是否是外部用户执行的节点(非组织结构人员参与处理工作的节点)?',
  `NodeAppType` int(11) DEFAULT '0' COMMENT '节点业务类型',
  `FWCSta` int(11) DEFAULT '0' COMMENT '节点状态',
  `SelfParas` varchar(500) DEFAULT NULL COMMENT '自定义参数',
  `RunModel` int(11) DEFAULT '0' COMMENT '节点类型',
  `SubThreadType` int(11) DEFAULT '0' COMMENT '子线程类型',
  `PassRate` float DEFAULT NULL COMMENT '完成通过率',
  `SubFlowStartWay` int(11) DEFAULT '0' COMMENT '子线程启动方式',
  `SubFlowStartParas` varchar(100) DEFAULT NULL COMMENT '启动参数',
  `ThreadIsCanDel` int(11) DEFAULT '0' COMMENT '是否可以删除子线程(当前节点已经发送出去的线程，并且当前节点是分流，或者分合流有效，在子线程退回后的操作)？',
  `ThreadIsCanShift` int(11) DEFAULT '0' COMMENT '是否可以移交子线程(当前节点已经发送出去的线程，并且当前节点是分流，或者分合流有效，在子线程退回后的操作)？',
  `IsAllowRepeatEmps` int(11) DEFAULT '0' COMMENT '是否允许子线程接受人员重复(仅当分流点向子线程发送时有效)?',
  `AutoRunEnable` int(11) DEFAULT '0' COMMENT '是否启用自动运行？(仅当分流点向子线程发送时有效)',
  `AutoRunParas` varchar(100) DEFAULT NULL COMMENT '自动运行SQL',
  `AutoJumpRole0` int(11) DEFAULT '0' COMMENT '处理人就是发起人',
  `AutoJumpRole1` int(11) DEFAULT '0' COMMENT '处理人已经出现过',
  `AutoJumpRole2` int(11) DEFAULT '0' COMMENT '处理人与上一步相同',
  `WhenNoWorker` int(11) DEFAULT '0' COMMENT '(是)找不到人就跳转,(否)提示错误.',
  `SendLab` varchar(50) DEFAULT NULL COMMENT '发送按钮标签',
  `SendJS` varchar(999) DEFAULT NULL COMMENT '按钮JS函数',
  `SaveLab` varchar(50) DEFAULT NULL COMMENT '保存按钮标签',
  `SaveEnable` int(11) DEFAULT '1' COMMENT '是否启用',
  `ThreadLab` varchar(50) DEFAULT NULL COMMENT '子线程按钮标签',
  `ThreadEnable` int(11) DEFAULT '0' COMMENT '是否启用',
  `ThreadKillRole` int(11) DEFAULT '0' COMMENT '子线程删除方式',
  `JumpWayLab` varchar(50) DEFAULT NULL COMMENT '跳转按钮标签',
  `JumpWay` int(11) DEFAULT '0' COMMENT '跳转规则',
  `JumpToNodes` varchar(200) DEFAULT NULL COMMENT '可跳转的节点',
  `ReturnLab` varchar(50) DEFAULT NULL COMMENT '退回按钮标签',
  `ReturnRole` int(11) DEFAULT '0' COMMENT '退回规则',
